import React, { Component } from "react";
import PhoneInput from "react-phone-input-2";
import "react-phone-input-2/lib/style.css";

class VisitComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      begin_date: "20-12-2019 05:00",
      end_date: "20-12-2019 06:00",
      concluded: 1,
      inst: "Universidade do Minho",
      dep: "Comissão de Ética",
      visited: "Pedro Henriques",
      comments: "Não sabem editar um excel",
      current: 0,
    };
  }
  render() {
    return (
      <div class="card">
        <div class="date">
          <p> Hora Entrada: {this.state.begin_date} </p>
          <p> Hora Saída: {this.state.end_date} </p>
        </div>
      </div>
    );
  }
}

export default VisitComponent;
